import{_ as e,o,c as a,O as t}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 24.2-663 When ballot void.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/24.2-663.md","filePath":"vacode/24.2-663.md"}'),n={name:"vacode/24.2-663.md"},r=t('<h1 id="§-24-2-663-when-ballot-void" tabindex="-1">§ 24.2-663 When ballot void. <a class="header-anchor" href="#§-24-2-663-when-ballot-void" aria-label="Permalink to &quot;§ 24.2-663 When ballot void.&quot;">​</a></h1><p>If a printed ballot is found to have been voted for a greater number of names for any one office than the number of persons required to fill the office, or if the title of the office is erased, the ballot shall be considered void as to all the names designated to fill such office, but no further, and the ballot shall be counted for the other offices on the ballot. In the case of a ballot scanner machine, an election official is authorized to cause the ballot scanner to receive the ballot and count it in accordance with this section. No ballot shall be void for having been voted for fewer names than authorized.</p><p>If any person votes, either in person or absentee, more than one time in an election, all ballots received from such person shall be void and, if possible, not counted. If one such ballot has already been cast, any additional ballots received from such person shall be void and not counted.</p><p>Code 1950, § 24-266; 1970, c. 462, § 24.1-140; 1978, c. 778; 1993, c. 641; 2013, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0469" target="_blank" rel="noreferrer">469</a>; 2014, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0540" target="_blank" rel="noreferrer">540</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0576" target="_blank" rel="noreferrer">576</a>.</p>',4),l=[r];function i(s,c,h,d,f,b){return o(),a("div",null,l)}const v=e(n,[["render",i]]);export{p as __pageData,v as default};
